        />\r\n<h5>Help</h5><h3>MasterView  Application Search</h3>\r\n\r\n<p><strong>Objective:</strong>&nbsp;Allows
        you to search on an Application within the local government area.&nbsp; </p>\r\n\r\n<p>MasterView
        Application Search screen allows the user to enter either the Application
        Number, Date Range, Application Type, Description or by address details.</p>\r\n\r\n<p>The
        user can select one or more details to fill in.&nbsp; <br/>Note: If you complete
        all the fields the application search will not work.</p>\r\n\r\n<p>Application
        Number:&nbsp;&nbsp;&nbsp; Type the Application Number ie N003/03</p>\r\n<p>Dates:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        \r\nType in the date range that you want to look at in the format dd/mm/yyyy</p>\r\n<p>Description:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        \r\nType in the description of the development</p>\r\n<p>Application Type:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        \r\nSelect the application type from the Application type list</p>\r\n<p>Street
        Number:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        \r\nType in the Street (house) Number or number range</p>\r\n<p>Street Name:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        \r\nType in the Street Name</p>\r\n<p>Suburb:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        \r\nType in the Suburb</p>\r\n<p>Show Determined Applications allows the user
        to search for all applications that are active or that have been submitted
        recently. By checking this it will enable the user to view historic\r\napplications.</p>\r\n\r\n\r\n\r\n<p>Once
